import React, { useEffect, useState } from 'react';
import '../node_modules/bootstrap/dist/css/bootstrap.min.css';
const App=()=>{
//     const apiData= fetch("https://api.covid19api.com/summary")
  const[data1,setData]=useState();


useEffect(()=>{
    fetch('https://api.covid19api.com/summary')
    .then(response => response.json())
    .then(abc => 
    setData(abc)
    );

},[])




return(
    <>
     <div className="wrapper">

     <ul>
      <>
          <table className="table">
          <thead>
          <tr>
            <th>Country Name</th>
            <th>Country Code</th>
            <th>Date</th>
            <th>ID</th>
            <th>NewDeaths</th>
            <th>NewRecovered</th>
</tr>
            </thead>
            {data1?.Countries.map(item => 
            <tbody>  
              <tr> 
              <td>{item.Country}</td>
              <td>{item.CountryCode}</td>
            </tr>
            </tbody>

             )}
          </table>      
       </>         

      { console.log(data1) }       
     </ul>
   </div>
   </>
)



}


export default App;
